records.addlTxt:
Defendant Megan A Janish in court with attorney Jorge R Fragoso.  Michele W. Hulgaard appeared for the State of Wisconsin.  Megan A. Janish pleads guilty to count #2.  Court finds the defendant guilty.  Count #1 is dismissed and read in.  State gives recommendations.  Attorney Fragoso makes statements.  Megan A. Janish makes statements. 

Court orders the following for Count #2:
Imposed and Stayed Sentence of:
6 months jail (Credit - 1 day).  

Term of Probation: 18 Months
Conditions of Probation:
-	AODA Assessment and follow through with any treatment recommended;
-	Absolute Sobriety; Random U.A.s;
-	No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
-	No Use or Possession of prescription drugs without a valid prescription;
-	Any valid prescription drugs must be taken in the manner in which they are prescribed;
-	Inform agent of all prescriptions;
-	Sign Medical Release for Agent;
--	Follow through with any treatment and/or counseling recommended by Agent;
-	No contact with Muskego Walmart .
-	Provide DNA sample if not yet provided  and pay surcharge
Costs: $278.00 to be paid as a condition of probation 
DNA Surcharge:  $250.00 to be paid as a condition of probation
DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
